svg.script:


		// on svg load, set required variables;
		// FIXME: should not clobber the global scope!!
		var logo_svgDoc,
		    logo_bg,
            logo_fg;

		var logo_fg_color = "#000000";
        var logo_fg_highlight_color = "#ffffff";
        var logo_bg_color = "#ffffff";
		var logo_bg_highlight_color = "#000000";


		function svgloaded(evt) {
   		//alert("loaded!");
			var svgDoc = evt.target;
			logo_svgDoc = svgDoc;
			logo_bg = svgDoc.getElementById("logo_bg");
			logo_fg = svgDoc.getElementById("logo_fg");
		}

		function restoreState() {
		    logo_bg.style.fill = logo_bg_color;
            logo_fg.style.fill = logo_fg_color;
		}

		function highlightState() {
		    logo_bg.style.fill = logo_bg_highlight_color;
            logo_fg.style.fill = logo_fg_highlight_color;
		}

        function messageUser() {
            alert("isn't life wonderful?");
        }
